plt.title('Correlation Heatmap')
plt.show()

house.mean()

"""#### Scaling"""

scaler = StandardScaler()
X_train_scaled = scaler.fit_transform(X_train)
X_test_scaled = scaler.transform(X_test)

param_grid_rf = {
    'n_estimators': [100, 150, 200, 250],
    'max_depth': [20, 30, 40, 50, 60],
    'min_samples_split': [2, 5, 10]
}

rf_model = RandomForestRegressor(random_state=42)
grid_search = GridSearchCV(rf_model, param_grid_rf, cv=5, scoring='neg_mean_squared_error', n_jobs=-1)
grid_search.fit(X_train_scaled, y_train)

best_rf = grid_search.best_estimator_

best_rf.score(X_test_scaled, y_test)

print("Best Parameters for Random Forest:", grid_search.best_params_)
rf_pred = best_rf.predict(X_test_scaled)
rf_rmse = mean_squared_error(y_test, rf_pred, squared=False)
print(f'Random Forest Regression RMSE after Hyperparameter Tuning: {rf_rmse}')

from sklearn.ensemble import GradientBoostingRegressor
param_grid_gb = {
    'n_estimators': [200, 300],
    'learning_rate': [0.05, 0.1, 0.2],
    'max_depth': [4, 5, 10]
}

gb = GradientBoostingRegressor(random_state=42)
grid_search_gb = GridSearchCV(gb, param_grid_gb, cv=5, scoring='neg_mean_squared_error', n_jobs=-1)
grid_search_gb.fit(X_train_scaled, y_train)

print("Best Parameters for Gradient Boosting:", grid_search_gb.best_params_)
gb_best = grid_search_gb.best_estimator_
gb_pred = gb_best.predict(X_test_scaled)
gb_rmse = mean_squared_error(y_test, gb_pred, squared=False)
print(f'Gradient Boosting Regression RMSE after Hyperparameter Tuning: {gb_rmse}')

gb_best.fit(X_train, y_train)
best_rf.fit(X_train, y_train)

gb_preds = gb_best.predict(X_test_scaled)
rf_preds = best_rf.predict(X_test_scaled)

